class FABSData:
    def __init__(self, submission_date, agency_code, data):
        self.submission_date = submission_date
        self.agency_code = agency_code
        self.data = data
        self.status = FABSStatus.PENDING

    def publish(self):
        # Implement publishing logic here
        self.status = FABSStatus.PUBLISHED

    def validate(self, validation_rules):
        for rule in validation_rules:
            if not rule.validate(self.data):
                self.status = FABSStatus.FAILED
                logger.error(f"FABS submission failed validation: {rule.description}")

class Broker:
    def __init__(self):
        self.fabs_submissions = []
        self.validation_rules = []

    def add_fabs_submission(self, fabs_data):
        self.fabs_submissions.append(fabs_data)

    def add_validation_rule(self, validation_rule):
        self.validation_rules.append(validation_rule)

    def process_fabs_submissions(self):
        for fabs_data in self.fabs_submissions:
            fabs_data.validate(self.validation_rules)
            if fabs_data.status == FABSStatus.PENDING:
                fabs_data.publish()

    def get_fabs_submissions(self):
        return self.fabs_submissions

