class FABSUser:
    def __init__(self, broker):
        self.broker = broker

    def submit_fabs_data(self, fabs_data):
        self.broker.add_fabs_submission(fabs_data)

    def get_fabs_submissions(self):
        return self.broker.get_fabs_submissions()

def main():
    # Create a Broker instance
    broker = Broker()

    # Create some FABS validation rules
    rule1 = FABSValidationRule(1, "Rule 1 description")
    rule2 = FABSValidationRule(2, "Rule 2 description")

    # Add validation rules to the Broker
    broker.add_validation_rule(rule1)
    broker.add_validation_rule(rule2)

    # Create some FABS data
    fabs_data1 = FABSData(datetime(2022, 1, 1), "AGENCY1", {"data": "some data"})
    fabs_data2 = FABSData(datetime(2022, 1, 2), "AGENCY2", {"data": "some more data"})

    # Submit FABS data
    fabs_user = FABSUser(broker)
    fabs_user.submit_fabs_data(fabs_data1)
    fabs_user.submit_fabs_data(fabs_data2)

    # Process FABS submissions
    broker.process_fabs_submissions()

    # Get FABS submissions
    fabs_submissions = fabs_user.get_fabs_submissions()

    # Log FABS submissions
    for fabs_data in fabs_submissions:
        logger.info(f"FABS submission: {fabs_data.submission_date}, {fabs_data.agency_code}, {fabs_data.status}")

    # Create a DataUser instance
    data_user = DataUser(broker)

    # Access raw agency published files
    raw_files = data_user.access_raw_agency_published_files("AGENCY1")
    logger.info(f"Raw agency published files: {raw_files}")

